(function(Drupal){'use strict';Drupal.behaviors.filmstripToggle={attach:function(context,settings){const showPhotosBtn=document.getElementById('showPhotos');const showVideosBtn=document.getElementById('showVideos');const filmStrip=document.querySelector('.filmstrip');const siteName=document.querySelector('.site-name');if(showPhotosBtn&&showVideosBtn&&!showPhotosBtn.hasAttribute('data-filmstrip-processed')){showPhotosBtn.setAttribute('data-filmstrip-processed','true');showVideosBtn.setAttribute('data-filmstrip-processed','true');let currentMode=null;function toggleFilmstrip(mode){const items=document.querySelectorAll('.filmstrip__item');items.forEach((item,index)=>{const hadPhoto=item.classList.contains('show-photo');const hadVideo=item.classList.contains('show-video');const wasActive=hadPhoto||hadVideo;if(wasActive&&(mode===null||(mode!=='photo'&&mode!=='video')))item.classList.add('flash--close');item.classList.remove('show-photo','show-video','flash');setTimeout(()=>{item.classList.remove('flash--close');if(mode==='photo'||mode==='video'){item.classList.add(mode==='photo'?'show-photo':'show-video');item.classList.add('flash');}const cleanFlash=()=>{item.classList.remove('flash','flash--close');item.removeEventListener('animationend',cleanFlash);};item.addEventListener('animationend',cleanFlash,{once:true});},index*75);});if(mode==='photo'){showPhotosBtn.classList.remove('inactive');showVideosBtn.classList.add('inactive');showPhotosBtn.classList.add('active');showVideosBtn.classList.remove('active');filmStrip.classList.add('photo');filmStrip.classList.remove('video');siteName.classList.add('photo');siteName.classList.remove('video');}else if(mode==='video'){showPhotosBtn.classList.add('inactive');showVideosBtn.classList.remove('inactive');showPhotosBtn.classList.remove('active');showVideosBtn.classList.add('active');filmStrip.classList.add('video');filmStrip.classList.remove('photo');siteName.classList.add('video');siteName.classList.remove('photo');}else{showPhotosBtn.classList.remove('inactive','active');showVideosBtn.classList.remove('inactive','active');filmStrip.classList.remove('photo','video');siteName.classList.remove('photo','video');}currentMode=mode;}document.addEventListener('click',function(e){if(!e.target.closest('.filmstrip')&&!e.target.closest('#showPhotos, #showVideos')&&currentMode)toggleFilmstrip(null);});showPhotosBtn.addEventListener('click',function(e){e.preventDefault();toggleFilmstrip('photo');});showVideosBtn.addEventListener('click',function(e){e.preventDefault();toggleFilmstrip('video');});document.addEventListener('click',function(e){const clickedInsideFilmstrip=e.target.closest('.filmstrip');const clickedOnMenuBtn=e.target.closest('#showPhotos, #showVideos');if(!clickedInsideFilmstrip&&!clickedOnMenuBtn&&currentMode){showPhotosBtn.classList.remove('inactive');showVideosBtn.classList.remove('inactive');showPhotosBtn.classList.remove('active');showVideosBtn.classList.remove('active');filmStrip.classList.remove('photo');filmStrip.classList.remove('video');siteName.classList.remove('photo');siteName.classList.remove('video');currentMode=null;document.querySelectorAll('.filmstrip__item').forEach((item)=>{item.classList.remove('show-photo','show-video');});}});}}};})(Drupal);;
(function(Drupal,once){Drupal.behaviors.autorGridBehavior={attach:function(context,settings){const gridContainers=once('autor-grid-init','.grid-container',context);gridContainers.forEach(function(gridContainer){const maxVisibleImages=5;function processAuthorGroups(){const authorNames=gridContainer.querySelectorAll('.grid-item-name');authorNames.forEach(function(authorName){const authorImages=[];let currentElement=authorName.nextElementSibling;while(currentElement&&!currentElement.classList.contains('grid-item-name')){if(currentElement.tagName==='A'&&currentElement.classList.contains('colorbox'))authorImages.push(currentElement);currentElement=currentElement.nextElementSibling;}if(authorImages.length>maxVisibleImages){for(let i=maxVisibleImages;i<authorImages.length;i++)authorImages[i].style.display='none';const indicator=document.createElement('span');indicator.textContent=` (+${authorImages.length-maxVisibleImages})`;indicator.className='more-images-indicator';indicator.title='Click para ver todas las imágenes';const targetImage=authorImages[maxVisibleImages-1];targetImage.appendChild(indicator);indicator.addEventListener('click',function(event){event.stopPropagation();event.preventDefault();const isExpanded=indicator.classList.contains('expanded');if(isExpanded){for(let i=maxVisibleImages;i<authorImages.length;i++)authorImages[i].style.display='none';indicator.classList.remove('expanded');indicator.textContent=` (+${authorImages.length-maxVisibleImages})`;indicator.title='Click para ver todas las imágenes';authorImages[maxVisibleImages-1].appendChild(indicator);}else{for(let i=maxVisibleImages;i<authorImages.length;i++)authorImages[i].style.display='block';indicator.classList.add('expanded');indicator.textContent=' (mostrar menos)';indicator.title='Click para mostrar menos imágenes';authorImages[authorImages.length-1].appendChild(indicator);}});}});}processAuthorGroups();});}};})(Drupal,once);;
